<div class="entities" style="line-height: 2.5; direction: ltr">Binding of human plasminogen to basement-membrane ( type IV ) collagen .

</mark>
 , the zymogen form of the serine proteinase plasmin , has been implicated in numerous physiological and pathological processes involving extracellular-matrix remodelling . We have previously demonstrated that the activation of plasminogen catalysed by tissue plasminogen activator is dramatically stimulated in the presence of basement-membrane-specific type IV collagen [ Stack , Gonzalez-Gronow &amp; Pizzo ( 1990 ) Biochemistry 29 , 4966-4970 ] . The present paper describes the binding of plasminogen to type IV collagen .

</mark>
 binds to both the alpha 1 ( IV ) and alpha 2 ( IV ) chains of basement-membrane collagen , with binding to the alpha 2 ( IV ) chain preferentially inhibited by 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 . This binding is specific and saturable , with Kd , app . values of 11.5 and 12.7 nM for collagen and gelatin respectively . Although collagen also binds to immobilized plasminogen , this interaction is unaffected by 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB00513
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">MEN</span>
</mark>
 . Limited elastase proteolysis of plasminogen generated distinct collagen-binding fragments , which were identified as the kringle 1-3 and kringle 4 domains . No binding of collagen to mini-plasminogen was observed . These studies demonstrate a specific interaction between plasminogen and type IV collagen and provide further evidence for regulation of plasminogen activation by protein components of the extracellular matrix .</div>

<h2 style="margin: 0">2</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">[ Thrombotic complications following the treatment of multiple myeloma with new agents ] . Patients with multiple myeloma ( MM ) are at an increased risk of venous and arterial thrombosis . The risk factors and pathomechanisms for thrombotic complications in multiple myeloma patients can be divided into the disease-related and treatment-specific risk factors . With the introduction of novel therapies , including talidomide , lenalidomide and bortezomib , the outcomes of the patients with newly diagnosed or previously treated multiple myeloma have improved , however the treatment affected the prothrombotic and anticoagulant processes . The risk of venous thromboembolism ( VTE ) in patients receiving immunomodulatory agent-based regimens ( thalidomide or lenalidomide ) , especially when used in combination with high-dose deamethasone - and / or anthracycline-based chemiotherapy is high . The proposed mechanisms for prothrombotic state include changes in 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P04275

</mark>
 , factor VIII , thrombomodulin , 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P25116
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 and 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P35354
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 epression , and some abnormalities in transcription factors and genetic risk factors . Moreover , dysregulation of anticoagulation and impairment of fibrinolysis may also contribute to hypercoagulability state . The incidence of VTE in bortezomib-containing regimens is very low . It may be due to inhibitory effect of bortezomib on platelet aggregation and NF-kappa / beta . This article presents the latest outlook upon the pathogenesis of thrombotic complications in multiple myeloma patients undergoing the therapy with new agents .</div>

<div class="entities" style="line-height: 2.5; direction: ltr">Pharmacological characterization of hydrolysis-resistant analogs of oleoylethanolamide with potent anorexiant properties . Oleoylethanolamide ( OEA ) is an endogenous lipid mediator that reduces food intake , promotes lipolysis , and decreases body weight gain in rodents by activating peroxisome proliferator-activated receptor-alpha (

<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 , HITT antibodies , heparin levels , and

 were measured . RESULTS : No patient had clinical symptoms of HITT . The LA - 15 column was found to efficiently remove

 significantly decreased after treatment . HITT antibodies were found in only two patients and were nonfunctional . Q02083 surface

 did not change during treatment . CONCLUSIONS : We have demonstrated that LDL apheresis via dextran sulfate absorption removes plasma

 and reduces the amount of

 on the surface of circulating PLTs . Reduced surface

<div class="entities" style="line-height: 2.5; direction: ltr">Spline-fitting with a genetic algorithm : a method for developing classification structure-activity relationships . Classification methods allow for the development of structure-activity relationship models when the target property is categorical rather than continuous . We describe a classification method which fits descriptor splines to activities , with descriptors selected using a genetic algorithm . This method , which we identify as SFGA , is compared to the well-established techniques of recursive partitioning ( RP ) and soft independent modeling by class analogy ( SIMCA ) using five series of compounds : cyclooxygenase - 2 (

 ) inhibitors , and monoamine oxidase ( MAO ) inhibitors . Only 1 - D and 2 - D descriptors were used . Approximately 40 % of compounds in each series were assigned to a test set , &quot; cherry-picked &quot; from the complete set such that they lie outside the training set as much as possible . SFGA produced models that were more predictive for all but the 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 set , for which SIMCA was most predictive . RP gave the least predictive models for all but the MAO set . A similar trend was observed when using training and test sets to which compounds were randomly assigned and when gradually eliminating compounds from the ( designed ) training set . The stability of models was examined for the random and reduced sets , where stability means that classification statistics and the selected descriptors are similar for models derived from different sets . Here , SIMCA produced the most stable models , followed by SFGA and RP . We show that a consensus approach that combines all three methods outperforms the single best model for all data sets .</div>

<div class="entities" style="line-height: 2.5; direction: ltr">Effect of milk hydrolysates on inflammation markers and drug-induced transcriptional alterations in cell-based models . Nonsteroidal anti-inflammatory drugs ( NSAID ) are associated with gastrointestinal inflammation and subsequent damage to the intestinal tissue . Earlier studies in our laboratory have found that specific casein hydrolysates ( CH ) might be useful in the treatment of gastrointestinal wounds . The underlying mechanisms that support inflammation and wound healing are not completely understood , but transcriptional alterations may be used as markers for inflammation and wound healing . The bioactivity of 3 CH prepared by treatment of commercial casein with pepsin ( 60 min ) followed by corolase ( 0 , 10 , or 60 min ) were investigated in intestinal epithelial cells treated with the NSAID indomethacin . The bioactivity was evaluated as transcriptional alterations of transforming growth factor- 1 ( TGF- 1 ) , cyclooxygenase - 2 (

 ) , peroxisome proliferator-activated receptor- (

 ( P &lt; 0.05 ) compared with hydrolysate treated with corolase for only 10 min whereas transcription of
